■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>デキる男の『モテ肌』ケア!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5397/1059826-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【ご使用方法】<br>・洗顔後の清潔なお肌に適量を手のひらまたはコットンにとり、ムラなくのばします。塗布後、約1時間程度、ローションが乾くまでは、洗い流したりふき取らないでください。<br>※使用後はすぐに石けんで手を洗ってください。<br>※顔以外にもご使用いただけます。<br>・本品は毎日お使いいただけます。肌色を継続させたい場合は、毎日お使いください。肌色を濃くしたい場合は、使用量・頻度を調整してください。<br>※発色には個人差があります。<br>・ご使用を中止後、1～2日後をピークに徐々に薄くなり、1週間程度で表皮の生まれ変わりのサイクルによって元へ戻ります。<br>※ターンオーバーには個人差があります。<br><br>【ご使用上の注意】<br>・本品使用中、赤み、はれ、かゆみ、刺激等の異常があらわれた場合は、使用を中止してください。そのまま化粧品類の使用を続けますと、症状を悪化させることがありますので、皮膚科専門医等に相談することをおすすめします。<br>・傷やはれもの、しっしん等、異常のある部位にはお使いにならないでください。<br>・目に入らないようご注意ください。入った場合は、こすらずにすぐ洗い流し、異物感が残る場合は、眼科医に相談してください。<br>・使用後はすぐに手を洗い流してください。<br>・使用後は必ずしっかりフタをしめてください。<br>・衣服は、完全に乾いてから着用し、特に襟にはご注意ください。衣服の素材によっては染色する場合もありますので、衣服などに付着しないようにご注意ください。万が一衣服に付着した場合は、すぐに洗剤などでていねいに洗い流してください。絹やウールなど素材によっては、洗剤で落ちない場合がありますので、着用を避けてください。<br>・本品使用中、衣服や寝具などに色移りする場合があります。すぐに洗剤などで洗い流してください。<br>・肌質などの違いにより発色効果には個人差があります。事前に目立たない部位で、翌日の発色度合いを確認することをおすすめします。<br>・成分の特性上、変色する場合がありますが、品質には問題ございません。<br>・本品はサンスクリーン効果がないため、紫外線を浴びる場合は、日焼け止めを併用することをおすすめします。<br>・本品を塗布し、乾いた後に日焼け止めを使用してください。<br>・高温又は低温の場所、日のあたる場所には保管しないでください。冷暗所での保管をおすすめします。<br>・乳幼児の手の届かないところに保管してください。<br>・本品は、皮脂、タンパク質に反応し発色するため、乾いた後に衣類を着用した場合でも、汗などに反応し衣類に色移りする場合がありますのでご注意ください。また、洗濯した衣類でも、細かな洗い残し等に反応し発色してしまう場合があります。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="652" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5397/1059826-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="1200" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5397/1059826-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="980" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5397/1059826-04.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="1166" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5397/1059826-05.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">セプテンバーは肌のケアをしながら、日焼けをせずとも、使うごとに自然な小麦肌を演出し、青ひげや肌ムラを目立ちにくくします。ビジネスシーンでも健康的な肌に見えるだけで、清潔感があり健康的な印象へチェンジ。自分で肌色をコントロールできるので、昔のセルフタンニング剤のように、過剰に色がつくこともありません。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">セプテンバーは肌のケアをしながら、日焼けをせずとも、使うごとに自然な小麦肌を演出し、青ひげや肌ムラを目立ちにくくします。ビジネスシーンでも健康的な肌に見えるだけで、清潔感があり健康的な印象へチェンジ。自分で肌色をコントロールできるので、昔のセルフタンニング剤のように、過剰に色がつくこともありません。(商品区分：化粧品　発売元：株式会社SUPLUS　製造販売元：株式会社アンプリー)</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">150ml</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：13×5×5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：300g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">水、グリセリン、ジヒドロキシアセトン、BG、エリスルロース、ヒアルロン酸Na、加水分解ヒアルロン酸、アセチルヒアルロン酸Na、加水分解コラーゲン、ベンジリデンジメトキシジメチルインダノン、セラミド3、ジヒドロキシプロピルアルギニンHCI、ポリクオタニウム-51、シアノコバラミン、コレステロール、ペンチレングリコール、4-t-ブチルシクロヘキサノール、デカルボキシカルノシンHCI、水添レシチン、プロパンジオール、クレアチン、ヒドロキシエチルセルロース、酸化チタン、シリカ、クエン酸Na、クエン酸、ブチルカルバミン酸ヨウ化プロピニルキスト</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
